import React from "react";

const buttonBack = (path, history) => {
    return (
        <NavLink
            to={{
                pathname: "/bazar",
                state: history.location.state,
            }}
        >
            <IoReturnUpBack />
        </NavLink>
    );
};

export default buttonBack;
